import navlogo from "../images/bc-nav-logo.png";
import classes from "../styles/Navbar.module.css";
import { useNavigate } from "react-router-dom";

export default function Header() {
  const navigate = useNavigate();

  return(
    <div>
      <nav id="navbar" className={classes.navbar}>
      <img src={navlogo} className={classes.logo} alt="Braving Counseling Logo for Navbar" />
      <ul>
        <li 
          className={classes.amaticScRegular}
          onClick={()=> {
            navigate('/home')
          }}
        >
          Home
        </li>
        <li 
          className={classes.amaticScRegular}
          onClick={()=> {
            navigate('/login')
          }}
        >
          Login
        </li>
        <li 
          className={classes.amaticScRegular}
          onClick={()=> {
            navigate('/about')
          }}
        >
          About
        </li>
        <li 
          className={classes.amaticScRegular}
          onClick={()=> {
            navigate('/services')
          }}
        >
          Services
        </li>
        <li 
          className={classes.amaticScRegular}
          onClick={()=> {
            navigate('/resources')
          }}
        >
          Resources
        </li>
        <li 
          className={classes.amaticScRegular}
          onClick={()=> {
            navigate('/faq')
          }}
        >
          FAQ
        </li>
        <li 
          className={classes.amaticScRegular}
          onClick={()=> {
            navigate('/contact')
          }}
        >
          Contact
        </li>
      </ul>
      </nav>
  </div>
  )
}
